import React from 'react';

const Form = props => {
    return (
        <form>
            <input type="text"
            placeholder="Wpisz miasto"
            value={props.value}
            onChange={props.change}
            />
            <button>Wyszukaj miasta</button>
        </form>
     );
}

export default Form;
